import { Link } from 'react-router-dom';
import './Header.scss';

const Header = () => {
  return(
    <header className="header"> 
      <h1 className="App-logo"><a href='/'><img src="https://media.tedbaker.com/content/design_system/icons/tedbaker_icon_Ted_Baker.svg" alt="Ted Baker Logo" /></a></h1>
      <nav>
        <Link className="nav-link" to="/more-about"><StyledNavLink>More Infos</StyledNavLink></Link>
        <Link className="nav-link" to="/plp"><StyledNavLink>Plps</StyledNavLink></Link>
        <Link className="nav-link" to="/contact"><StyledNavLink>Contact</StyledNavLink></Link>
        <Link className="nav-link" to="/converter"><StyledNavLink>Converter</StyledNavLink></Link>
      </nav>
    </header>
  );
}

export default Header;
